Loss (2008)

Litouwen
Drama
96 minuten

geregisseerd door Maris Martinsons
met Valda Bickute, Kostas Smoriginas en Dalia Micheleviciute

Valda, een jonge geesteszieke vrouw, is vanuit Litouwen naar Ierland verhuisd op zoek naar een beter leven. Maar ze heeft haar zoontje Paul achtergelaten, die nu opgroeit bij de kinderloze Nora, ex-vrouw van zakenman Ben. Nora heeft nu niet alleen te maken met de nieuwe minnares van haar ex-man, maar moet ook vechten om de voogdij van 'haar' kind. Aangezien Valda er op uit is om met genoeg verdiend geld haar kind weer terug te krijgen.

